class iatAPI{constructor(){this.endPoints={POST_results:function(e){$.ajax({type:"POST",url:"api/result",contentType:"application/json",dataType:"json",data:JSON.stringify(e),error:function(){alert("An unexpected error occurred when posting the test results! Please contact server admin"),window.location.href="discriminacion.colmex.mx/"}})},POST_survey:function(e,t){$.ajax({type:"POST",url:"api/survey",contentType:"application/json",dataType:"json",data:JSON.stringify(e),success:t,error:function(){alert("An unexpected error occurred when posting the survey results! Please contact server admin"),window.location.href="discriminacion.colmex.mx/"}})},GET_results:function(e){$.ajax({type:"GET",url:"api/result",contentType:"application/json",dataType:"json",success:e,error:function(){alert("An unexpected error occurred when getting the test results! Please contact server admin"),window.location.href="discriminacion.colmex.mx/"}})},GET_stimuli:function(e,t){$.ajax({type:"GET",url:`api/stimuli?stage=${e}`,dataType:"json",success:t,error:function(){alert("An unexpected error occurred when getting the test stimuli! Please contact server admin"),window.location.href="discriminacion.colmex.mx/"}})}}}}